import React, { Component } from 'react';

// third-party
import { NavLink } from 'react-router-dom';
import { IconMenuDotsSvg } from '../../content/images/svg';

// data
import data from './../../data/data';

export class MenuDots extends Component {
    render() {
        return (
            <Link to="" className="menu-dots_link">
                <span>
                    <IconMenuDotsSvg className="menu-dots_button-icon" />
                </span>
            </Link>
        );
    }
}
